import './Expenses.css';

function ExpenseItem() {
    const presetDate = new Date().toLocaleDateString();
    const expenseTitle = "Car Insurance";
    const epenseAmount = 345.78;
    return (
        <div className="expense-item">
            <div>{presetDate}</div>
            <div className="expense-item__description">
                <h2>Car Insurance</h2>
                <div className="expense-item_price">$455</div>
            </div>
        </div>
    )
}

export default ExpenseItem;
